import styled from "styled-components";

export const Input = styled.div`
  margin: 0 0 2em;
  height: 100px;
  width: 20%;
  text-align: center;
  padding: 1em;
  border-bottom: 1px solid ${({ theme }) => theme.colors.grey1};
`;
